import React from 'react';

const newItem = document.getElementById('groceryInput')
const name = 'Alan'
console.log(name)

const GroceryList = () => {
    return (
        <div className='groceryForm'>
            <form>
                <label htmlFor='groceries'>Enter Item</label><br></br>
                <input type='text' id='groceryInput' value='value' placeholder='Peanut Butter'></input>
            </form>

            <ul className='groceryList'>
                <li>Peanut Butter<button id='editButton'>Edit</button><button id='deleteButton'>Delete</button></li>
            </ul>

        </div>
    );
}

export default GroceryList;
